"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[48986],{73608:(e,a,i)=>{i.r(a),i.d(a,{default:()=>o});var n=i(26440);const r=[(0,n.uE)('<p>Para ubicar la ventana <strong>Generar Orden de Salida (Orden de Venta/Distribución)</strong> dentro del menú de ADempiere, seleccione la carpeta <strong>Gestión Avanzada de Almacenes</strong>, luego seleccione la carpeta <strong>Operaciones de Salida</strong> y finalmente seleccione la ventana <strong>Generar Orden de Salida (Orden de Venta/Distribución)</strong>.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/44b08780-fda8-48ee-894b-58b2f3a8a1c9" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 1. Menú de ADempiere</p><p>Podrá visualizar la siguiente ventana para generar la orden de salida desde una orden de venta o una orden de distribución.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/21610e58-a20e-44bb-91f6-048a54309dc5" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 2. Ventana Generar Orden de Salida (Orden de Venta/Distribución)</p><p>Seleccione en el campo <strong>Organización</strong>, la organización para la cual esta realizando el registro.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/1e14641c-976a-4c25-907f-d7361cb8dd8c" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 3. Campo Organización</p><p>Seleccione en el campo <strong>Tipo de Movimiento</strong>, el tipo de movimiento desde el cual requiere generar la orden de salida.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/b320b69d-6532-4683-92de-f12efff9ce79" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 4. Campo Tipo de Movimiento</p><p>Seleccione en el campo <strong>Tipo de Documento</strong>, el tipo de documento por el cual requiere filtrar la búsqueda para generar la orden de salida.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/1d1d49f4-e8ec-42b8-9de7-1533c320f104" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 5. Campo Tipo de Documento</p><p>Seleccione en el campo <strong>Almacén</strong>, el almacén por el cual requiere filtrar la búsqueda para generar la orden de salida.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/cc6fea5e-2871-48f4-9534-a8cece843043" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 6. Campo Almacén</p><p>Seleccione en el campo <strong>Región de Ventas</strong>, la región de ventas por la cual requiere filtrar la búsqueda para generar la orden de salida.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/791bca17-14e9-4648-b816-d1bca60739f7" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 7. Campo Región de Ventas</p><p>Seleccione en el campo <strong>Agente Comercial</strong>, el agente comercial por el cual requiere filtrar la búsqueda para generar la orden de salida.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/0a21a4be-4f94-45d1-8de1-b4feac749850" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 8. Campo Agente Comercial</p><p>Seleccione en el campo <strong>Tipo Documento Destino</strong>, el tipo de documento destino por el cual requiere filtrar la búsqueda para generar la orden de salida.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/a481f21a-bf2c-494a-8bd0-b072de8fcd34" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 9. Campo Tipo Documento Destino</p><p>Seleccione en el campo <strong>Regla de Entrega</strong>, la regla de entrega por la cual requiere filtrar la búsqueda para generar la orden de salida.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/efb96391-60b3-4aa5-bcba-05fc5b69ffc3" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 10. Campo Regla de Entrega</p><p>Seleccione en el campo <strong>Vía de Entrega</strong>, la vía de entrega por la cual requiere filtrar la búsqueda para generar la orden de salida.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/80308f76-31d2-4a48-8469-fc3cdbef510b" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 11. Campo Vía de Entrega</p><p>Seleccione en el campo <strong>Transportista</strong>, la transportista por la cual requiere filtrar la búsqueda para generar la orden de salida.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/ca27e333-75d7-438e-81e0-7c29ec106fe5" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 12. Campo Transportista</p><p>Seleccione en el campo <strong>F. Documento</strong>, la fecha del documento por la cual requiere filtrar la búsqueda para generar la orden de salida.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/15d43378-d0c5-4645-94da-6c45201d6824" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 13. Campo F. Documento</p><p>Seleccione en el campo <strong>Fecha de Entrega</strong>, la fecha de entrega por la cual requiere filtrar la búsqueda para generar la orden de salida.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/2c9d2c2c-1710-49e2-9d1c-65bb0426f9a0" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 14. Campo Fecha de Entrega</p><p>Seleccione en el campo <strong>Acción en el Documento</strong>, la acción en el documento por la cual requiere filtrar la búsqueda para generar la orden de salida.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/34f6684a-cf0f-47f5-ba0b-4b8666c38fee" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 15. Campo Acción en el Documento</p><p>Seleccione la opción <strong>Buscar Registros</strong>, para filtrar la información a base a los campos utilizados.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/05e98c67-061f-4f89-b94e-bd050ad38d60" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 16. Opción Buscar Registros</p><p>Podrá visualizar la ventana de la siguiente manera, donde ADempiere le mostrará en el cuadro superior, todas las órdenes que esten pendientes por generarle orden de salida. Debe seleccionar los registros deseados, tildando el cuadrito que se encuentra a principio de cada línea.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/30e41b81-0d79-42ae-93cc-e09244137df1" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 17. Resultado de Búsqueda de Órdenes</p><p>Luego de tildar la información en el cuadro de órdenes, se visualiza en el cuadro inferior las líneas que contiene la orden. Debe seleccionar los registros deseados, tildando el cuadrito que se encuentra al principio de cada línea.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/638134bb-81d0-4d6b-95be-59e0e7464711" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 18. Resultado de Búsqueda de Líneas de las Órdenes</p><p>Seleccione en el campo <strong>Ubicación</strong>, la ubicación a la cual se entregara el producto.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/c1003bf7-5459-43d6-b5d2-efa4f5921bf7" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 19. Campo Ubicación</p><p>Finalmente, seleccione la opción <strong>OK</strong> para completar el proceso.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/23faac6a-e45d-4f3b-9448-126f9e2ec6de" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 20. Opción OK</p><p>ADempiere mostrará la siguiente ventana, con el mensaje <strong>Generar Orden?</strong>. Debe seleccionar la opción <strong>OK</strong> para generar la orden de salida.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/3040b1d3-8d4a-4690-be87-a30861e5af35" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 21. Mensaje Generar Orden</p><p>Finalmente, ADempiere le mostrará la siguiente ventana, donde indica el mensaje <strong>Imprimir Orden</strong>, seguido del número de correlativo de orden de salida generado. Debe seleccionar la opción para imprimir la orden de salida generada.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/3037e13d-7a8f-4c25-9dd9-06e1c624037c" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 22. Mensaje Imprimir Orden</p><p>De igual manera puede ubicar la orden de salida en la ventana <strong>Orden de Salida</strong>, con el número de correlativo generado anteriormente.</p><figure><img src="https://github.com/erpcya/docs/assets/52334433/ffb3f693-fff3-4470-8d1a-aedb139dcb2f" alt="image" tabindex="0" loading="lazy"><figcaption>image</figcaption></figure><p>Imagen 23. Orden de Salida Generada</p>',69)],t={},o=(0,i(71212).Z)(t,[["render",function(e,a){return(0,n.wg)(),(0,n.iD)("div",null,r)}]])},88660:(e,a,i)=>{i.r(a),i.d(a,{data:()=>n});const n=JSON.parse('{"key":"v-6ab0990a","path":"/docs/distribution-management/outbound-order.html","title":"","lang":"es-ES","frontmatter":{"description":"Para ubicar la ventana Generar Orden de Salida (Orden de Venta/Distribución) dentro del menú de ADempiere, seleccione la carpeta Gestión Avanzada de Almacenes, luego seleccione la carpeta Operaciones de Salida y finalmente seleccione la ventana Generar Orden de Salida (Orden de Venta/Distribución).","head":[["meta",{"property":"og:url","content":"https://docs-md.erpya.com/docs/distribution-management/outbound-order.html"}],["meta",{"property":"og:description","content":"Para ubicar la ventana Generar Orden de Salida (Orden de Venta/Distribución) dentro del menú de ADempiere, seleccione la carpeta Gestión Avanzada de Almacenes, luego seleccione la carpeta Operaciones de Salida y finalmente seleccione la ventana Generar Orden de Salida (Orden de Venta/Distribución)."}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"es-ES"}],["meta",{"property":"og:updated_time","content":"2024-04-01T16:27:33.000Z"}],["meta",{"property":"article:author","content":"ERP Consultores y Asociados, C.A."}],["meta",{"property":"article:modified_time","content":"2024-04-01T16:27:33.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2024-04-01T16:27:33.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"ERP Consultores y Asociados, C.A.\\",\\"url\\":\\"https://erpya.com\\"}]}"]]},"headers":[],"git":{"createdTime":1711988853000,"updatedTime":1711988853000,"contributors":[{"name":"TaniaLucena","email":"52334433+TaniaLucena@users.noreply.github.com","commits":1}]},"readingTime":{"minutes":2.81,"words":844},"filePathRelative":"docs/distribution-management/outbound-order.md","localizedDate":"1 de abril de 2024","excerpt":"<p>Para ubicar la ventana <strong>Generar Orden de Salida (Orden de Venta/Distribución)</strong> dentro del menú de ADempiere, seleccione la carpeta <strong>Gestión Avanzada de Almacenes</strong>, luego seleccione la carpeta <strong>Operaciones de Salida</strong> y finalmente seleccione la ventana <strong>Generar Orden de Salida (Orden de Venta/Distribución)</strong>.</p>","autoDesc":true}')}}]);